    Description: 'The Boutique at South Valley Sanctuary is a place where victims of domestic violence and their children can come to buy clothing, shoes, jewelry, makeup and other items with "chore bucks" that they earn. At the Boutique, residents can enjoy a diversion from their stress and trauma and begin collecting the belongings they need to rebuild their lives. The Boutique is open on Mondays and Wednesdays from 7:00 PM to 8:00 PM. Volunteers generally arrive at 6:30 to set up and leave at 8:30.\r\n\r\nShort-term volunteers (under six months of involvement) will need to fill out a volunteer application, Department of Human Services Code of Conduct form, and a Confidentiality Agreement form. Long-term volunteers (over six months of involvement) will also need to pass a background check and participate in 24 hours of training.',
