    Description: 'Join author and Olympic gold medalist, Kristi Yamaguchi, for a special storytime featuring her new book, Cara\'s Kindess.\r\nAs Cara the cat is struggling to choose a soundtrack for her figure skating performance, she notices that Darby the dog seems a little down. When she discovers Darby is sad because he doesn\'t know how to ice skate, Cara happily puts aside her problem to help out a friend with the caveat that Darby should pay it forward. Before long, Darby helps out a friend, who helps out another friend, and the circle of kindness makes its way back to Cara just in time for her figure skating performance!\r\nPlaces in the signing line are reserved for those who purchase a copy of Cara\'s Kindess from The King\'s English.\r\nGET YOUR COPY NOW! Pre-order your signed copy of Cara\'s Kindess today, by either calling the store at 801-484-9100 or ordering online. Please specify if you will be attending the event and if you want your book personalized.',
