    Description: '**ARTIST STATEMENT**\r\n___\r\nThese images express an interchangeability of landscape and self. The landscape is both a place and a viewer at the same time. It has its own experiences and asks its own questions, but these experiences and questions can easily be exchanged with those of the viewer.\r\n\r\nIn the form of self, these paintings show places in transition that the viewer can relate to their own life\'s transitions. This is why the landscape is a liminal place, where it is unclear if it is night or day and where the sky and earth are sharing certain elements. The water cycle, the geological cycle, and the life cycle take place in one image. The impression is given that the land is experiencing everything in a shortened time span, as if a million years were condensed into one moment and as if that experience were no different from the experience a human has in one lifetime. In this way, the viewer can be reminded of their inevitable transition from nonexistence to existence and back again.\r\n\r\nIt is not lost on the viewer that the images have been gathered in the Western United States. This does not fail to be important either. In the Colorado Plateau and Utah\'s West Desert, the infinite almost seems tangible.\r\n\r\nFinally, I want to suggest that there are personalities inherent in the land that are created by both natural and human events. These events linger just like traumas and joys linger in humans. I intend for these paintings to reveal these events so they appear as they are: playing on repeat forever.\r\n\r\n**\r\n___\r\n**\r\n\r\n**ARTIST BIOGRAPHY**\r\n___\r\nBen Kilbourne is a musician, painter, and intermedia artist from Southern Utah. His work is often built out of the landscapes of the West (particularly the Colorado Plateau) but it expresses much broader themes. His main interest lies in asking these persistent questions: Who are we as humans? How do we relate to the rest of the world? He lives in Salt Lake City.',
