    Description: 'PIONEER THEATRE COMPANY PRESENTS the classic play \r\n\r\n***The Glass Menagerie*** **\r\n\r\nWritten by Tennessee Williams   \r\n\r\n \r\n\r\n \r\n\r\n**Salt Lake City, UT -  **Pioneer Theatre Company presents *The Glass Menagerie**,* October 21 throughNovember 5, 2016.\r\n\r\n___\r\n\r\n*The Glass Menagerie* is a memory play that premiered in 1944 and catapulted Williams from obscurity to fame. Amanda Wingfield and her painfully shy daughter Laura await the arrival of "the Gentleman Caller" who will transform the dross of their everyday lives into fine-spun gold.\r\n\r\n \r\n\r\n**WHO:**\r\n\r\nPioneer Theatre Company\r\n\r\n \r\n\r\n**WHAT:**\r\n\r\n*The Glass Menagerie *\r\n\r\nBy Tennessee Williams\r\n\r\n___\r\n\r\n**WHEN:**\r\n\r\nOctober 21 - November 5, 2016\r\n___\r\n\r\n \r\n\r\n**TIMES:**\r\n\r\nNEW TIMES FOR 2016/2017 Season\r\n\r\nMondays - Thursdays, 7:00 p.m.\r\n\r\nFridays and Saturdays, 7:30 p.m.\r\n\r\nSaturday matinees, 2:00 p.m.\r\n\r\n \r\n\r\n**WHERE:**\r\n\r\nSimmons Pioneer Memorial Theatre\r\n\r\n300 South 1400 East, Salt Lake City\r\n\r\n \r\n\r\n**PRICES:**\r\n\r\n$25 - $44 in advance, and $5 more when purchased on the day of the show\r\n\r\nKids in grades K-12 are half-price on Mondays and Tuesdays\r\n\r\n \r\n\r\n**MORE INFO:   **\r\n\r\nBox Office: 801-581-6961\r\n\r\nOpen 10:00 a.m. - 6:00 p.m., Mon - Fri\r\n\r\nwww.pioneertheatre.org',
