    Description: 'Felipe Esparza is a comedian and actor, best known for his raw, real-life comedy that audiences everywhere can relate to. Recognized for his wild hair and his often-imitated phrase, “what’s up, fool?”, people are surprised to find out that Felipe is also the same person referred to and imitated in infamous stories by fellow comedian, Gabriel Iglesias. Felipe won NBC’s Last Comic Standing in 2010, and soon after, starred in and produced his first 1 hour Showtime special, and is now touring comedy clubs and theaters across the world and working on a new 1 hour special. He also launched a popular new podcast April 1, 2014, entitled, “What’s Up Fool?”, on the All Things Comedy podcast network.\r\n\r\n*   21+ Show -\r\n\r\n**Live Comedy** : Genre: Rated R (Mild), Special Event',
