    Description: 'Through pointed humor, satirical characters, and striking colors, Reale’s performances in the videos *Cantando na chuva *(*Singing in the Rain*)(2014)*, Palomo *(2012), and *Untitled* (2011) investigate current social conflicts involving issues of criminal justice, capitalism, and gender inequality.\r\n\r\nWearing a dog muzzle and an androgynous police uniform in *Palomo*, Reale sits atop a brightly painted red horse and arbitrarily patrols unusually vacant city streets, an image that simultaneously pokes fun of the police force while soberly suggesting a dormant, violent danger.[1] Naked and hogtied to a horizontal pole in *Untitled*, the artist is carried through** **bustling crowds who gawk and point, eliciting questions of how violence against women is often condoned or ignored altogether. In *Cantando na chuva*,* *Reale is unrecognizable in a gold suit complete with a gold gas mask and a gold umbrella as she dances to the title song of the 1952 Hollywood classic *Singing in the Rain. *Dancing through a landfill among the *catadores*(pickers)* *who routinely sift through the piles of trash in the background, Reale presents a contrast** **between the backbreaking actions* *of the workers** **and the frivolous nature of a material-obsessed world.  Reale’s work depicts a different Brazilian reality that is often substituted for tropical imagery and samba dancers, provoking audiences to consider the social conflicts in Brazil and to recognize the universal nature of such issues in their own lives.',
